import React from 'react';
import Graph from './Graph.png';
import './Main.css';
import * as d3 from 'd3';

const Main = () => {
  return (
    <div className='main-container'>
      return (
      <svg
        style={{
          height: 500,
          width: '100%',
          marginRight: '0px',
          marginLeft: '0px',
        }}
      >
        <g className='plot-area' />
        <g className='x-axis' />
        <g className='y-axis' />
      </svg>
      );
    </div>
  );
};

export default Main;
